import React, { useState, useEffect } from 'react';

const SuperAdminDashboard = () => {
  // Mock data - in a real app, this would come from an API
  const [stats, setStats] = useState({
    totalRequests: 0,
    completedRequests: 0,
    pendingRequests: 0,
    delayedRequests: 0,
    totalResidents: 0
  });

  const [delayedRequestsList, setDelayedRequestsList] = useState([]);
  const [activeTab, setActiveTab] = useState('dashboard');

  // Simulate loading data
  useEffect(() => {
    // In a real app, you would fetch this from your backend
    setStats({
      totalRequests: 1254,
      completedRequests: 980,
      pendingRequests: 210,
      delayedRequests: 64,
      totalResidents: 532
    });

    setDelayedRequestsList([
      { id: 1001, resident: 'John Doe', expectedTime: '24h', delay: '12h' },
      { id: 1002, resident: 'Jane Smith', expectedTime: '48h', delay: '5h' }
    ]);
  }, []);

  return (
    <div className="super-admin-dashboard">
      <header>
        <h1>Super Admin Dashboard</h1>
        <nav>
          <button onClick={() => setActiveTab('dashboard')}>Dashboard</button>
          <button onClick={() => setActiveTab('reports')}>Reports</button>
        </nav>
      </header>

      {activeTab === 'dashboard' && (
        <div className="dashboard-content">
          <div className="stats-grid">
            <div className="stat-card">
              <h3>Total Requests</h3>
              <p>{stats.totalRequests}</p>
            </div>
            <div className="stat-card">
              <h3>Completed</h3>
              <p>{stats.completedRequests}</p>
            </div>
            <div className="stat-card">
              <h3>Pending</h3>
              <p>{stats.pendingRequests}</p>
            </div>
            <div className="stat-card">
              <h3>Delayed</h3>
              <p>{stats.delayedRequests}</p>
            </div>
            <div className="stat-card">
              <h3>Total Residents</h3>
              <p>{stats.totalResidents}</p>
            </div>
          </div>
        </div>
      )}

      {activeTab === 'reports' && (
        <div className="reports-content">
          <h2>Request Reports</h2>
          
          <div className="report-section">
            <h3>Request Summary</h3>
            <div className="summary-stats">
              <p>Total: {stats.totalRequests}</p>
              <p>Completed: {stats.completedRequests}</p>
              <p>Pending: {stats.pendingRequests}</p>
              <p>Delayed: {stats.delayedRequests}</p>
            </div>
          </div>

          <div className="report-section">
            <h3>Delayed Requests</h3>
            <table>
              <thead>
                <tr>
                  <th>Request ID</th>
                  <th>Resident</th>
                  <th>Expected Time</th>
                  <th>Delay</th>
                </tr>
              </thead>
              <tbody>
                {delayedRequestsList.map(request => (
                  <tr key={request.id}>
                    <td>{request.id}</td>
                    <td>{request.resident}</td>
                    <td>{request.expectedTime}</td>
                    <td>{request.delay}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      )}
    </div>
  );
};

export default SuperAdminDashboard;
